    "count": 1,
    "resultType": 3,
    "prompt": [{"type": 1, "keyword": "华容区", "admins": [{"name": "北京市", "adminCode": 156110000}]}],
    "mclayer": "",
    "keyWord": "华容区"
  };
  export default {
    data () {
      return {
        dataForm: {
          eid: '',
          rangeInfo: '',
          directionInfo: '',
          placeInfo: 1
        },
        lnglats: [],
        enterpriseName: '',
        x: '',
        y: '',
        dataListLoading: false,
        dataRule: {}
      }
    },
    methods: {
      init (eid, enterpriseName, x, y) {
        this.enterpriseName = enterpriseName
        this.dataForm.eid = eid
        // 初始化地图对象
        map = new T.Map('mapDiv')
        map.centerAndZoom(new T.LngLat(114.76119, 30.302767), zoom)// 设置显示地图的中心点和级别
        // 创建企业标注
        var icon = new T.Icon('../../../../static/img/blu.png', new T.Point(20, 20))
        var marker = new T.Marker(new T.LngLat(x, y), icon)
        map.addOverLay(marker)
        // map.setMapType(TMAP_HYBRID_MAP);  // 卫星图
        // 绘制边界
        this.drawArea(eChengArea, 0.4, 'rgba(170,223,161,0)')
        this.drawArea(huaRongArea, 0.4, 'rgba(170,223,161,0)')
        this.drawArea(liangZiHuArea, 0.4, 'rgba(170,223,161,0)')
        // 显示周边环境信息
        this.zbChange()
      },
      zbChange () {
        this.$http({
          url: this.$http.adornUrl(`/enterprise/enterprisePeripheryInfo/getPeripheryInfo/` + this.dataForm.eid + `/` + this.dataForm.placeInfo),
          method: 'get',
          params: this.$http.adornParams()
        }).then(({data}) => {
          if (data && data.code === 0) {
            this.removeTMaker();
            this.lnglats = data.list
            this.drawTMakers(data.list);
          }
        })
      },
      // 绘制边界
      drawArea (json, opacity, AreaColor) {
        var area = json.area
        var points = area.points
        // 如果有区域坐标信息，画出此行政区的多边形。
        if (points && points.length != 0) {
          // 面的线的样式
          var style = {
            strokeColor: 'green',
            fillColor: AreaColor,
            strokeWeight: 3,
            strokeOpacity: 1,
            fillOpacity: opacity, // 透明度，
            strokeStyle: 'solid' // 实线

          }
          for (var i = 0; i < points.length; i++) {
            var region = points[i].region// 单个面
            var pointArr = region.split(',')
            var pointsz = []
            for (var j = 0; j < pointArr.length - 1; j++) {
              var p = pointArr[j]
              var pArr = p.split(" ")
              var point = new T.LngLat(pArr[0], pArr[1])
              pointsz.push(point)
            }
            var poly = new T.Polygon(pointsz, style)
            map.addOverLay(poly)
          }
        }
      },
      drawTMakers (lnglats) {
        for (var x in lnglats) {
          var icon = new T.Icon('../../../../static/img/blu.png', new T.Point(20, 20))
          var marker = new T.Marker(new T.LngLat(lnglats[x].mapX, lnglats[x].mapY), icon) // 创建标注
          content = lnglats[x].buildingInfo

          markers[x] = marker
          map.addOverLay(marker)               // 将标注添加到地图中
          addMouseoverHandler(content, marker)
        }

        function addMouseoverHandler (content, marker) {
          marker.addEventListener('mouseover', function (e) {
              openInfo(content, e)
            }
          )
        }

        function openInfo (content, e) {
          var point = e.lnglat
          marker = new T.Marker(point)// 创建标注
          customerWinInfo = new T.InfoWindow(content, {offset: new T.Point(0, -30)}) // 创建信息窗口对象
          map.openInfoWindow(customerWinInfo, point) //开启信息窗口
        }
      },
      // 切换界面时移除
      onClose () {
        // alert("进入移除方法");
        if (customerWinInfo != null) {
          map.removeOverLay(customerWinInfo);
        }
      },
      // 移除覆盖物
      removeTMaker () {
        for (var x in markers) {
          map.removeOverLay(markers[x])
        }
        this.onClose()
      }
    }
  }
</script>

